import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar';
import Hero from './components/Hero';
import About from './components/About';
import Service from './components/Service';
import Data from './components/Data';
import Blog from './components/Blog';
import Brain from './components/Brain';
import Form from './components/ContactForm';
import WhyUs from './components/WhyUs';
import Blogsec from './components/BlogSection';
import Footer from './components/Footer';
import BlogPostStandalone from './components/BlogPostStandalone'; // Import the new standalone blog page

const App = () => {
  return (
   <>
    <div>
        <Navbar />
        <Hero />
        <About />
        <Service />
        <Data />
        <Blog />
        <Brain />
        <Form />
        <WhyUs />
        <Blogsec />
        <Footer />


      </div> {/* Define routes for the app */}
        <Routes>
          {/* Route for displaying the full blog post */}
          <Route path="/blog/:id" element={<BlogPostStandalone />} />
        </Routes>
   </>


  );
};

export default App;
